import React from "react";

const userInput = () => {

    const inputStyle = {
        padding: "1rem .5rem",
        borderRadius: "5px"
    };

    return (
        <div>
            <input type="text" placeholder="enter a new username..." style={inputStyle} />
        </div>
    );
};

export default userInput;
